import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './Subpages/home';
import About from './Subpages/home';
import Portfolio from './Subpages/Portfolio';
import Enquiry from './pages/Enquiry';
import ContactUs from './pages/ContactUs';
import Testimonials from './pages/Testimonials';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Header with Navbar */}
        <div className="bg-[#4A7A63] text-[#F4F1DE] py-4">
          <header className="container mx-auto flex justify-between items-center">
            <div>
              <img src="media/top_garden2_crop.png" alt="Top Garden Logo" />
            </div>
            <div className="text-3xl font-bold text-[#E07A5F]">
              <h1>Top Garden</h1>
            </div>
            <nav>
              <ul className="flex space-x-6">
                <li><Link to="/" className="hover:underline text-[#F4F1DE]">Home</Link></li>
                <li><Link to="/about" className="hover:underline text-[#F4F1DE]">About</Link></li>
                <li><Link to="/portfolio" className="hover:underline text-[#F4F1DE]">Portfolio</Link></li>
                <li><Link to="/enquiry" className="hover:underline text-[#F4F1DE]">Enquiry</Link></li>
                <li><Link to="/contact" className="hover:underline text-[#F4F1DE]">Contact Us</Link></li>
                <li><Link to="/testimonials" className="hover:underline text-[#F4F1DE]">Testimonials</Link></li>
              </ul>
            </nav>
          </header>
        </div>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/portfolio" element={<Portfolio />} />
          <Route path="/enquiry" element={<Enquiry />} />
          <Route path="/contact" element={<ContactUs />} />
          <Route path="/testimonials" element={<Testimonials />} />
        </Routes>

        {/* Footer */}
        <footer className="bg-[#E07A5F] text-[#F4F1DE] text-center py-6">
          <p>&copy; 2024 Top Garden Website. All rights reserved.</p>
          <ul className="flex justify-center space-x-6 mt-4">
            <li><a href="#privacy" className="hover:underline text-[#F4F1DE]">Privacy Policy</a></li>
            <li><a href="#terms" className="hover:underline text-[#F4F1DE]">Terms of Service</a></li>
          </ul>
        </footer>
      </div>
    </Router>
  );
}

export default App;
